# Session State Initialization
if 'graph' not in st.session_state:
    st.session_state.graph = None
if 'nodes' not in st.session_state:
    st.session_state.nodes = []
if 'embeddings' not in st.session_state:
    st.session_state.embeddings = None
if 'chat_history' not in st.session_state:
    st.session_state.chat_history = []

def load_graph_data():
    if os.path.exists("graph.gexf"):
        try:
            graph = nx.read_gexf("graph.gexf")
            nodes = []
            embeddings = []
            for node_id, data in graph.nodes(data=True):
                nodes.append(data['chunk'])
                embeddings.append([float(x) for x in data['embedding'].split(',')])
            
            st.session_state.graph = graph
            st.session_state.nodes = nodes
            st.session_state.embeddings = np.array(embeddings)
            return True
        except Exception as e:
            st.error(f"Error loading existing graph: {e}")
    return False

# Sidebar
with st.sidebar:
    st.title("üï∏Ô∏è Graph RAG")
    st.markdown("---")
    
    st.subheader("Manage Knowledge Base")
    uploaded_files = st.file_uploader("Upload PDF Documents", type="pdf", accept_multiple_files=True)
    
    if st.button("Build Knowledge Graph"):
        if not uploaded_files:
            st.warning("Please upload at least one PDF.")
        else:
            with st.status("Building Graph...", expanded=True) as status:
                all_chunks = []
                for uploaded_file in uploaded_files:
                    st.write(f"Processing {uploaded_file.name}...")
                    text = load_pdf(uploaded_file)
                    chunks = chunk_text(text)
                    all_chunks.extend(chunks)
                
                st.write(f"Generating embeddings for {len(all_chunks)} chunks...")
                embeddings = generate_embeddings(all_chunks)
                
                st.write("Constructing relationship graph...")
                graph = build_graph(all_chunks, embeddings)
                
                st.write("Saving graph...")
                nx.write_gexf(graph, "graph.gexf")
                
                # Update Session State
                st.session_state.graph = graph
                st.session_state.nodes = all_chunks
                st.session_state.embeddings = np.array(embeddings)
                
                status.update(label="Graph Built Successfully!", state="complete", expanded=False)
                st.success(f"Built graph with {len(all_chunks)} chunks.")

    st.markdown("---")
    if st.session_state.graph:
        st.success(f"Knowledge Base Active: {len(st.session_state.nodes)} chunks")
    else:
        if not load_graph_data():
            st.info("No knowledge base found. Please upload PDFs and build the graph.")

# Main Interface
st.title("Chat with your Knowledge Graph")

# Display Chat History
for message in st.session_state.chat_history:
    with st.chat_message(message["role"]):
        st.markdown(message["content"])

# Chat Input
if prompt := st.chat_input("Ask a question about your documents..."):
    if not st.session_state.graph:
        st.error("Please build the knowledge graph first.")
    else:
        # User message
        st.session_state.chat_history.append({"role": "user", "content": prompt})
        with st.chat_message("user"):
            st.markdown(prompt)

        # Assistant response
        with st.chat_message("assistant"):
            with st.spinner("Thinking..."):
                # 1. Generate query embedding
                query_embedding = generate_embeddings([prompt])[0]

                # 2. Retrieve relevant chunks
                indices, similarities = get_most_similar_indices(query_embedding, st.session_state.embeddings, k=5)
                context_chunks = [st.session_state.nodes[i] for i in indices]

                # 3. Expand context with graph neighbors
                expanded_context = set(context_chunks)
                for idx in indices:
                    # GEXF might store IDs as strings, while in-memory build uses ints
                    node_id = idx if idx in st.session_state.graph else str(idx)
                    if node_id in st.session_state.graph:
                        neighbors = list(st.session_state.graph.neighbors(node_id))
                        for neighbor in neighbors:
                            expanded_context.add(st.session_state.graph.nodes[neighbor]['chunk'])

                # 4. Generate answer
                answer = get_answer(prompt, list(expanded_context))
                
                st.markdown(answer)
                
                # Show sources in an expander
                with st.expander("View Retrieved Sources"):
                    for i, source in enumerate(expanded_context):
                        st.markdown(f"**Source {i+1}:**")
                        st.markdown(f"<div class='chunk-container'>{source}</div>", unsafe_allow_html=True)

        st.session_state.chat_history.append({"role": "assistant", "content": answer})
